import './App.css';
import React, { Fragment } from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <div>    
      <Router>
        <div>
          <nav>
            <ul>
              <li>
                <Link to="/">Home</Link>
              </li>
              <li>
                <Link to="/about">About</Link>
              </li>
              <li>
                <Link to="/users">Users</Link>
              </li>
            </ul>
          </nav>

          <Fragment>
            <Routes>
              <Route path="/" element={<Home/>} />
              <Route path="/users">
                <Users />
              </Route>
              <Route path="/about">
                <About />
              </Route>
            </Routes>
          </Fragment>
        </div>
      </Router>
    </div>
  )
}

function Home() {
  return <h2>Home</h2>;
}

function About() {
  return <h2>About</h2>;
}

function Users() {
  return <h2>Users</h2>;
}


export default App;
